	@RequestMapping(value = "paySign")
	public void paySign(PayRequest payRequest, HttpServletResponse response) {

		log.info("--签名发来的参数：" + JSON.toJSONString(payRequest));

		TreeMap<String, String> result = new TreeMap<String, String>();
		ChannleMerchantConfigKey keyinfo = clientCollectionPayService
				.getChannelConfigKey(payRequest.getMerchantId());
		// 获取商户秘钥
		String key = keyinfo.getMerchantkey();
		result.putAll(JsdsUtil.beanToMap(payRequest));
		String paramSrc = RequestUtils.getParamSrc(result);
		log.info("签名前数据**********支付:" + paramSrc);
		String md5 = MD5Utils.sign(paramSrc, key, "UTF-8");
		log.info("签名**********支付:" + md5);
		try {
			outString(response, md5);
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}

	}
	@RequestMapping(value = "pay")
	public void pay(PayRequest payRequest, HttpServletResponse response) {

		log.info("------代付上传参数：" + JSON.toJSONString(payRequest));
		Map<String, String> result = new HashMap<>();
		ChannleMerchantConfigKey keyinfo = clientCollectionPayService
				.getChannelConfigKey(payRequest.getMerchantId());
		// 获取商户秘钥
		String key = keyinfo.getMerchantkey();
		TreeMap<String, String> results = new TreeMap<String, String>();
		TreeMap<String, String> results1 = new TreeMap<String, String>();
		results.putAll(JsdsUtil.beanToMap(payRequest));
		String paramSrc = RequestUtils.getParamSrc(results);
		log.info("验证签名前字符串" + paramSrc);
		boolean b = MD5Utils
				.verify(paramSrc, payRequest.getSign(), key, "UTF-8");
		if (b) {
			log.info("签名正确");
			log.info("签名正确");
			payRequest.setUrl(payRequest.getNotifyUrl());
			payRequest.setType("cjPay");
			result = service.pay(payRequest, result);

			log.info("返回的参数:" + JSON.toJSON(result));
		} else {
			result.put("respCode", "0001");
			result.put("respMsg", "签名错误！");
		}
		results1.putAll(result);
		String paramSrc1 = RequestUtils.getParamSrc(results1);
		log.info("---返回数据签名签的数据:" + JSON.toJSONString(paramSrc1));
		String md5 = MD5Utils.sign(paramSrc1, key, "UTF-8");
		result.put("sign", md5);
		try {
			outString(response, JSON.toJSONString(result));
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}

	}
	@RequestMapping(value="quickPay")
	public void quickPay(PayRequest payRequest, HttpServletResponse response){
		log.info("畅捷------上传参数：" + JSON.toJSONString(payRequest));
		Map<String, String> result = new HashMap<>();
		ChannleMerchantConfigKey keyinfo = clientCollectionPayService
				.getChannelConfigKey(payRequest.getMerchantId());
		// 获取商户秘钥
		String key = keyinfo.getMerchantkey();
		TreeMap<String, String> results = new TreeMap<String, String>();
		TreeMap<String, String> results1 = new TreeMap<String, String>();
		results.putAll(JsdsUtil.beanToMap(payRequest));
		String paramSrc = RequestUtils.getParamSrc(results);
		log.info("验证签名前字符串" + paramSrc);
		boolean b = MD5Utils.verify(paramSrc, payRequest.getSign(), key, "UTF-8");
		if (b) {
			log.info("签名正确");
			payRequest.setUrl(payRequest.getNotifyUrl());
			payRequest.setReUrl(payRequest.getReturnUrl());
			if("cj001".equals(payRequest.getType())){
				payRequest.setType("10");
			}else if("cj002".equals(payRequest.getType())){
				payRequest.setType("11");
			}else if("cj003".equals(payRequest.getType())){
				payRequest.setType("12");
			}else if("cj004".equals(payRequest.getType())){
				payRequest.setType("13");
			}else if("cj005".equals(payRequest.getType())){
				payRequest.setType("14");
			}else if("cj006".equals(payRequest.getType())){
				payRequest.setType("15");
				result = service.register(payRequest, result);//商户注册
			}else if("cj007".equals(payRequest.getType())){
				payRequest.setType("16");
				result = service.openMessages(payRequest, result);//侧开通短信
			}else if("cj008".equals(payRequest.getType())){
				payRequest.setType("17");
				result = service.OpenCard(payRequest, result);//侧绑卡开通
			}else if("cj009".equals(payRequest.getType())){
				payRequest.setType("18");
			}else if("cj010".equals(payRequest.getType())){
				payRequest.setType("19");
			}else if("cj011".equals(payRequest.getType())){
				payRequest.setType("20");
				result = service.payCode(payRequest, result);//支付短信
			}else if("cj012".equals(payRequest.getType())){
				log.info("进来了");
				payRequest.setType("21");
				result = service.consumerPayment(payRequest, result);//消费
			}else if("cj013".equals(payRequest.getType())){
				payRequest.setType("22");
			}else if("cj014".equals(payRequest.getType())){
				payRequest.setType("23");
				result = service.update(payRequest, result);//更新
			}else if("cj015".equals(payRequest.getType())){
				payRequest.setType("25");
				result = service.withdrawals(payRequest, result);//代付
			}else if("cj016".equals(payRequest.getType())){
				payRequest.setType("27");
				result = service.balance(payRequest, result);//余额查询
			}else if("cj017".equals(payRequest.getType())){
				payRequest.setType("28");
				result = service.paySelect(payRequest, result);//代付查询
			}else if("cj018".equals(payRequest.getType())){
				payRequest.setType("29");
				result = service.bill(payRequest, result);//查询对账单
			}else {
				result.put("respCode", "0001");
				result.put("respMsg", "type is null");
			}
			log.info("返回的参数:" + JSON.toJSON(result));
		} else {
			result.put("respCode", "0001");
			result.put("respMsg", "签名错误！");
		}
		
		if(result!=null&&result.size()>0) {
			
		}else {
			OriginalOrderInfo originalInfo;
			try {
				originalInfo = this.ihfbService.getOriginOrderInfo(payRequest.getMerchantId());
				ThreadPool.executor(new PayThread(service, payRequest,originalInfo));
				result.put("merchantId", payRequest.getMerchantId());
				result.put("merchantCode", payRequest.getMerchantCode());
				result.put("respCode", "00");
				result.put("respMsg", "请求成功,请看异步或查询");
				result.put("orderId",payRequest.getOrderId());
				result.put("amount", payRequest.getAmount());
			} catch (Exception e) {
				// TODO Auto-generated catch block
				e.printStackTrace();
			}
		}
		results1.putAll(result);
		String paramSrc1 = RequestUtils.getParamSrc(results1);
		log.info("---返回数据签名签的数据:" + JSON.toJSONString(paramSrc1));
		String md5 = MD5Utils.sign(paramSrc1, key, "UTF-8");
		result.put("sign", md5);
		try {
			outString(response, JSON.toJSONString(result));
		} catch (IOException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
	}
	@RequestMapping(value="notifyUrl")
	public void notifyUrl(HttpServletResponse response,HttpServletRequest request){
		log.info("畅捷通异步来了！！ ");
		String str;
		try {
			Map<String, String> result = new HashMap<String, String>();
			BufferedReader br = new BufferedReader(
					new InputStreamReader((ServletInputStream) request.getInputStream(), "UTF-8"));
			String line = null;
			StringBuffer sb = new StringBuffer();
			while ((line = br.readLine()) != null) {
				sb.append(line);
			}
			String appMsg = sb.toString();
			System.out.println(appMsg);
			JSONObject json =JSONObject.parseObject(appMsg);
			log.info("畅捷通异步参数:"+json);
			String respCode=json.getString("respCode");
			String respMsg=json.getString("respMsg");
			String requestId=json.getString("requestId");
			String orderId=json.getString("orderId");
			String orderStatus=json.getString("orderStatus");
			String payNo=json.getString("payNo");
			String payAmount=json.getString("payAmount");
			String payDate=json.getString("payDate");
			String merchantCode=json.getString("merchantCode");
			String merchantFee=json.getString("merchantFee");
			String withdrawDepositFee=json.getString("withdrawDepositFee");
			String receiveAmount=json.getString("receiveAmount");
			String settleDate=json.getString("respCode");
			String sign=json.getString("sign");
			log.info("畅捷通异步orderStatus:"+orderStatus);
			PayRequest payRequest =new PayRequest();
			payRequest.setOrderId(orderId);
			OriginalOrderInfo originalInfo = null;
			Map<String, String> map =new HashMap<>();
			
			map.put("merchantCode", merchantCode);
			map.put("payDate", payDate);
			map.put("orderId", orderId);
			map.put("requestId", requestId);
			map.put("payNo", payNo);
			map.put("merchantFee", merchantFee);
			map.put("withdrawDepositFee", withdrawDepositFee);
			map.put("receiveAmount", receiveAmount);
			map.put("settleDate", settleDate);
			map.put("orderStatus", orderStatus);
			
			if(orderId!=null && orderId!= "" &&respCode!="" &&respCode!=null){
				str = "success";
				outString(response, str);
				originalInfo = this.ihfbService.getOriginOrderInfo(orderId);
				if("000000".equals(respCode)){
					if("0".equals(orderStatus)){
						respCode="200";
						respMsg="待支付";
						ThreadPool.executor(new PayThread(service, payRequest,originalInfo));
					}else if("1".equals(orderStatus)){
						//处理中
						respCode="200";
						respMsg="处理中";
						ThreadPool.executor(new PayThread(service, payRequest,originalInfo));
					}else if("2".equals(orderStatus)){
						log.info("来了！！！");
						service.updateByOrderId(orderId, orderStatus, result);//成功
						respCode="00";
						respMsg="成功";
						Calendar cal1 = Calendar.getInstance();
						TimeZone.setDefault(TimeZone.getTimeZone("GMT+8:00"));
						java.text.SimpleDateFormat sdf = new SimpleDateFormat("kk:mm:ss");
						log.info("真来了！！！1111");
						if (sdf.parse(sdf.format(new Date(Long.parseLong(String.valueOf(payDate))))).getTime() > sdf.parse("21:00:00").getTime()
								&& sdf.parse(sdf.format(new Date(Long.parseLong(String.valueOf(payDate))))).getTime() < sdf.parse("09:00:00").getTime()) {
							log.info("时间不在正常入金时间内!");
							map.put("type", "1");
							//service.UpdatePmsMerchantInfo(originalInfo,map);
						}else{
							log.info("真来了！！！222");
							map.put("type", "0");
							//service.UpdatePmsMerchantInfo(originalInfo,map);
					    }
						log.info("真来了！！！333");
					}else if("3".equals(orderStatus)){
						service.updateByOrderId(orderId, orderStatus, result);//请求超时
						respCode="02";
						respMsg="请求超时";
					}else if("4".equals(orderStatus)){
						service.updateByOrderId(orderId, orderStatus, result);// 交易未受理。，默认失败
						respCode="01";
						respMsg="失败";
					}else if("5".equals(orderStatus)){
						service.updateByOrderId(orderId, orderStatus, result);//失败
						respCode="01";
						respMsg="失败";
					}
				}else {
					service.updateByOrderId(orderId, orderStatus, result);//失败
					respCode="01";
					respMsg="失败";
				}
				ChannleMerchantConfigKey keyinfo = clientCollectionPayService
						.getChannelConfigKey(originalInfo.getPid());
				// 获取商户秘钥
				String key = keyinfo.getMerchantkey();
				String paramSrc = "merchantId="+originalInfo.getPid()+"&orderId="+orderId+"&amount="+payAmount+"&respCode="+respCode+"&respMsg="+respMsg;
				log.info("签名前数据**********畅捷支付:" + paramSrc);
				String md5 = MD5Utils.sign(paramSrc, key, "UTF-8");
				paramSrc=paramSrc+"&sign="+md5;
				
				String result1=HttpURLConection.httpURLConnectionPOST(originalInfo.getBgUrl(),paramSrc);
				log.info("下游返回状态" + result1);
				if (!"SUCCESS".equals(result1)) {
					ThreadPool.executor(new UtilThread(originalInfo
						.getBgUrl(), paramSrc));
				}
			}else{
				str = "FAIL";
				outString(response, str);
			}
			
			
		} catch (Exception e) {
			// TODO: handle exception
		}
	}
	
	
